import React from 'react';
import Log from './Log';
import { Routes, Route } from "react-router-dom";
import Nav from './Nav';
function App() {
  return (
    <div>
      <Nav/>
      <Routes>
        <Route path = "/" element = {<Log/>}></Route>
      </Routes>
    </div>
  )
}
export default App
